// Get all input data (array of rows)
const rows = $input.all().map(item => item.json);

// Convert to JSON string for AI model (clean formatting)
const dataset = JSON.stringify(rows, null, 2);

// Output formatted dataset
return [{ json: { dataset } }];

let output = $json.output || $json.text || $json.data || "[]";

output = output
  .replace(/^```json/i, "")
  .replace(/```$/, "")
  .trim();

try {
  const parsed = JSON.parse(output);
  return parsed.map(item => ({ json: item }));
} catch (e) {
  return [{ json: { error: "AI output not valid JSON", raw: output } }];
}

let rows = $input.all().map(item => item.json);
rows = rows.map(r => {
  for (let key in r) {
    if (r[key] === "" || r[key] === "N/A" || r[key] === null || r[key] === "null") {
      r[key] = null;
    }
  }
  return r;
});
return [{ json: { dataset: JSON.stringify(rows) } }];

const messy = $json.originalDataset; // Keep from your earlier step
const cleaned = $json.cleanedDataset || $json.output; // from AI Agent

return [{
  json: {
    messy_data: messy,
    cleaned_data: cleaned
  }
}];

